import React from 'react';
import { saveVote } from '../../helper/events';
import './css/hotel.css';
import {RatedServices} from './ratedServices/ratedServices';
import {VoteComponent} from '../voteComponent/voteComponent';
export const HotelComponent = ({hotels=[]})=>{
    return (
        <div className='hotels'>
                {hotels.map((hotel)=>{
                    return(
                        <div>
                        <div key={hotel.id} className='hotel'>
                            <p>{hotel.name}</p>
                            <RatedServices services={hotel.services}/>
                                <button className='votebtn' onClick={saveVote(hotel)} >How you treated?</button>
                        </div>

                             </div>
                    )

                })}
        </div>
    )
}
